import { Box } from '@mui/material'

const TabPanel = (props) => {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        {...other}
      >
        {value === index && (
          <Box style={{paddingTop: 30, paddingLeft : 20}} >
            {children}
          </Box>
        )}
      </div>
    );
  }
  export default Tabs;
